PROCEDURE Proc_InsertDetailModuleClass (IN ModuleClassID char(36), IN StudentID char(36), IN FrequentPoints1 float, IN FrequentPoints2 float, IN MediumScore float, IN StudentCode varchar(255), IN ModuleClassCode varchar(255))
BEGIN
  DECLARE IDstudent char(36);
  DECLARE IDmoduleclass char(36);
  IF (StudentCode IS NOT NULL
