CREATE PROCEDURE Proc_GetPracticeSchedules ()
SQL SECURITY INVOKER
BEGIN
  SELECT
    p.PracticeScheduleID,
    p.Date,
    p.PracticeShiftID,
    p.Status,
    p.Description,
    p.StartTime,
    p.EndTime,
    p.Request,
    p1.PracticeShiftName,
    p.PracticeGroupID,
    p2.PracticeGroupName,
    p.PracticalLaboratoryID,
    p3.PracticalLaboratoryName,
    s.SchoolYearID,
    s.SchoolYearName,
    s1.SemesterID,
    s1.SemesterName,
    t.TeacherID,
    t.FullName
  FROM practiceschedule p
    JOIN practiceshift p1
      ON p.PracticeShiftID = p1.PracticeShiftID
    JOIN practicegroup p2
      ON p.PracticeGroupID = p2.PracticeGroupID
    JOIN practicallaboratory p3
      ON p.PracticalLaboratoryID = p3.PracticalLaboratoryID
    JOIN schoolyear s
      ON p.SchoolYearID = s.SchoolYearID
    JOIN semester s1
      ON p.SemesterID = s1.SemesterID
    JOIN teacher t
      ON p2.TeacherID = t.TeacherID
  ORDER BY p1.PracticeShiftName;
END
$$

