PROCEDURE Proc_Insertuser (IN UserName varchar(255), IN PassWord varchar(255), IN PermissionID char(36), IN FullName varchar(255), IN Email varchar(50), IN PhoneNumber varchar(255))
BEGIN
  INSERT INTO user (UserID, UserName, PassWord, PermissionID, FullName, PhoneNumber, Email, CreatedDate, ModifiedDate)
    VALUES (UUID(), UserName, PassWord, PermissionID, FullName, PhoneNumber, Email, NOW(), NOW());

END
$$

--
-- Create procedure `Proc_Insertsubject`
--
CREATE PROCEDURE Proc_Insertsubject (IN SubjectName varchar(255))
SQL SECURITY INVOKER
BEGIN
  INSERT INTO subject (SubjectID, SubjectName, CreatedDate, ModifiedDate)
    VALUES (UUID(), SubjectName, NOW(), NOW());

END
$$

--
-- Create procedure `Proc_Insertmodule`
--
CREATE PROCEDURE Proc_Insertmodule (IN ModuleCode varchar(20), IN ModuleName varchar(255), IN NumberOfModule float, IN Theory float, IN Practice float, IN BigExercise float, IN SubjectID char(36))
SQL SECURITY INVOKER
BEGIN
  INSERT INTO module (ModuleID, ModuleCode, ModuleName, NumberOfModule, Theory, Practice, BigExercise, SubjectID, CreatedDate, ModifiedDate)
    VALUES (UUID(), ModuleCode, ModuleName, NumberOfModule, Theory, Practice, BigExercise, SubjectID, NOW(), NOW());

END
$$

--
-- Create procedure `Proc_Getsubjects`
--
CREATE PROCEDURE Proc_Getsubjects ()
SQL SECURITY INVOKER
BEGIN
  SELECT
    *
  FROM subject s
  ORDER BY s.SubjectName;
END
$$

--
-- Create procedure `Proc_GetsubjectById`
--
CREATE PROCEDURE Proc_GetsubjectById (IN subjectId char(36))
SQL SECURITY INVOKER
BEGIN
  SELECT
    *
  FROM subject s
  WHERE s.SubjectID = subjectId;
END
$$

--
-- Create procedure `Proc_Getmodules`
--
CREATE PROCEDURE Proc_Getmodules ()
SQL SECURITY INVOKER
BEGIN
  SELECT
    m.ModuleID,
    m.ModuleCode,
    m.ModuleName,
    m.NumberOfModule,
    m.Theory,
    m.Practice,
    m.BigExercise,
    m.SubjectID,
    m.CreatedDate,
    m.ModifiedDate,
    s.SubjectName
  FROM module m
    LEFT JOIN subject s
      ON m.SubjectID = s.SubjectID
  ORDER BY s.SubjectName;
END
$$

--
-- Create procedure `Proc_GetmoduleById`
--
CREATE PROCEDURE Proc_GetmoduleById (IN moduleId char(36))
SQL SECURITY INVOKER
BEGIN
  SELECT
    m.ModuleID,
    m.ModuleCode,
    m.ModuleName,
    m.NumberOfModule,
    m.Theory,
    m.Practice,
    m.BigExercise,
    m.SubjectID,
    m.CreatedDate,
    m.ModifiedDate,
    s.SubjectName
  FROM module m
    LEFT JOIN subject s
      ON m.SubjectID = s.SubjectID
  WHERE m.ModuleID = moduleId
  ORDER BY m.CreatedDate OR m.ModifiedDate DESC;
END
$$

--
-- Create procedure `Proc_FindPracticalLaboratory`
--
CREATE PROCEDURE Proc_FindPracticalLaboratory (IN ID char(36))
SQL SECURITY INVOKER
BEGIN
  SELECT
    p.PracticalLaboratoryID,
    p.PracticalLaboratoryCode,
    p.PracticalLaboratoryName,
    p.Status
  FROM practicallaboratory p
  WHERE p.PracticalLaboratoryID = ID;
END
$$

--
-- Create procedure `Proc_Deleteuser`
--
CREATE PROCEDURE Proc_Deleteuser (IN UserID char(36))
SQL SECURITY INVOKER
BEGIN
  DELETE
    FROM user
  WHERE USER.UserID = UserID;
END
$$

--
-- Create procedure `Proc_Deletesubject`
--
CREATE PROCEDURE Proc_Deletesubject (IN subjectId char(36))
SQL SECURITY INVOKER
BEGIN
  DELETE
    FROM subject
  WHERE SUBJECT.SubjectID = subjectId;

END
$$

--
-- Create procedure `Proc_Deletemodule`
--
CREATE PROCEDURE Proc_Deletemodule (IN moduleId char(36))
SQL SECURITY INVOKER
BEGIN
  DELETE
    FROM module
  WHERE MODULE.ModuleID = moduleId;

END
$$

